質量的金融服務。在簽訂本協議之前，請客戶充分瞭解澳門國際銀行提供的相關金融服務内容及收费標准，自主决定是否選擇相關金融服務。\n      甲方:申请人\n      乙方:澳門威際银行股份有限公司\n      爲明確雙方的權利和義務，规範雙方業務行爲，甲方、乙方雙方本著平等互利的原则，就電子银行服務相關事宜達成本協議。\n      第一条  定義\n      如無特别說明下列用語在本協議中的含義爲:\n“電子银行”是指乙方通過網絡和電子終端爲客户提供自助金融服務的虚擬銀行。澳門國際銀行電子銀行通過雷話銀行、網上銀行、手機銀行等爲客戶服務，據此客户可透過電子渠道或電訊媒介翰入用户名稱及密码後，进行银行交易或從银行獲取相關服務。\n      “密碼”指客户自行設定並用於驗證客戶身份的字元資訊，包括登錄密码、交易密码等。\n      “動熊密碼”是指按照特定規則動熊産生並用於識别客户身份的字元组合，通過電子银行管渠向乙方發出，其载體包括電子银行安全密码器、手機短信等。","color":{"rgb":{"r":102,"g":102,"b":102},"hsl":{"h":0,"s":0,"l":40},"alpha":255,"color-hex":"#666666 100%","argb-hex":"#FF666666","rgba-hex":"#666666FF","css-rgba":"rgba(102,102,102,1)","css-hsla":"hsla(0,0%,40%,1)","ui-color":"(r:102.00 g:102.00 b:102.00 a:1.00)"},"fontSize":16,"fontFace":"PingFang SC","textAlign":"left","letterSpacing":0,"lineHeight":26,"css":["width: 374;","height: 655;","font-family: FZHTFW--GB1-0;","font-size: 16px;","color: #666666;","letter-spacing: 0;","line-height: 26px;","font-weight: 400;"]},{"objectID":"9A019035-E8EB-45D8-BAC1-FF0CBB34642E","type":"text","name":"澳明威","rect":{"x":20,"y":228,"width":48,"height":26},"shadows":[],"rotation":0,"opacity":1,"borders":[],"fills":[],"styleName":"","content":"澳明威","color":{"rgb":{"r":102,"g":102,"b":102},"hsl":{"h":0,"s":0,"l":40},"alpha":255,"color-hex":"#666666 100%","argb-hex":"#FF666666","rgba-hex":"#666666FF","css-rgba":"rgba(102,102,102,1)","css-hsla":"hsla(0,0%,40%,1)","ui-color":"(r:102.00 g:102.00 b:102.00 a:1.00)"},"fontSize":16,"fontFace":"FZHei-B01T","textAlign":"left","letterSpacing":0,"lineHeight":26,"css":["width: 48;","height: 26;","font-family: FZHTFW--GB1-0;","font-size: 16px;","color: #666666;","letter-spacing: 0;","line-height: 26px;","font-weight: 400;"]},{"objectID":"E9D44B48-E586-4B6A-9F83-FB1BFE7E9EC6","type":"text","name":"際","rect":{"x":68,"y":228,"width":16,"height":26},"shadows":[],"rotation":0,"opacity":1,"borders":[],"fills":[],"styleName":"","content":"際","color":{"rgb":{"r":102,"g":102,"b":102},"hsl":{"h":0,"s":0,"l":40},"alpha":
